import React from 'react';
import './Cards.css';
import PropTypes from 'prop-types';
import { Button } from '@mui/base/Button';





function InfoCard() {
  return (
    <div className='cardsInfo'>
        <div className='container-info-row'>
           <div className='info'>
                  <label> Envíanos tus datos y uno de  <br/>nuestros agentes te contactará <br/></label>
                  <form className="custom-form">
                <label htmlFor="name">Nombre Completo:</label>
                <input type="text" id="name" name="name" placeholder="Ingresa tu nombre aquí..." />

                <label htmlFor="email">Correo Electrónico:</label>
                <input type="email" id="email" name="email" placeholder="Ingresa tu correo electrónico..." />

                <label htmlFor="phoneNumber">Número de Teléfono:</label>
                <input type="tel" id="phoneNumber" name="phoneNumber" placeholder="Ingresa tu número telefónico..." />

                <button type="submit">Enviar</button>
                </form>

           </div>
           {/* <div className="logo-column">
            <div className="logo-container">
                <img className="imagen" src='./images/HaciendaPlayaBlanca-Blanco.png' alt="Hacienda Playa Blanca" />
                <img className="imagen" src='./images/TerraticaLogo.png' alt="Terratica Logo" />
            </div>
            </div> */}
        </div>
    </div>
  );
}

export default InfoCard;
